import './filter.scss';

function Filter() {
  return (
    <div className='filter'>
      <h1>Search results for <b>Kathmandu</b> </h1>
      <div className="top">
        <div className="item">
          <label htmlFor="city"></label>
        </div>
      </div>
      <div className="top"></div>
    </div>
  )
}

export default Filter
